import '../Moonapp.css'

function Moonapp() {
  return (
    <div className='moon-app-container'>
      <div class="main">
        <div class="second">
          <div class="last"></div>
        </div>
        <div class="second-two">
          <div class="last-two"></div>
        </div>
    </div>
  </div>
  );
};

export default Moonapp;
